import React from 'react';
// import './Footer.css';

const Footer = () => {
  return (
    <section className="footer">
  <h2>Vivian's Garden Homestay</h2>
  <div className="footer-content">

  <img className="footer-logo" src={`${process.env.PUBLIC_URL}/vivian-source/logo.jpg`} alt="Logo" />

    <div className="policy-section">
      <h3 className='section'>Điều Khoản</h3>
      <ul>
        <li><a href="#policy1">Policy 1</a></li>
        <li><a href="#policy2">Policy 2</a></li>
        <li><a href="#policy3">Policy 3</a></li>
      </ul>
    </div>

    <div className="contact-section">
      <h3 className='section'>Contact</h3>
      <ul>
        <li><i className="fas fa-phone"></i> <a href="tel:091351966">091351966</a></li>
        <li><i className="fas fa-map-marker-alt"></i> Vivian's Garden Homestay, Thôn Trán Voi, Phú Mãn, Quốc Oai, Hà Nội</li>
        <li><i className="fas fa-envelope"></i> <a href="mailto:vudangquangtung@gmail.com">vudangquangtung@gmail.com</a></li>
      </ul>
    </div>

  </div>
  <a href="https://www.facebook.com/viviangardenhomestay" target="_blank" rel="noopener noreferrer">
    <i className="fab fa-facebook fa-3x"></i>
  </a>
</section>

  );
};

export default Footer;
